package java_examples;

public class whileloop {
	public static void printline(){
		int numberofastricks = 10;
		while (numberofastricks>=5 ) {
			System.out.print("*");
			numberofastricks--;
		}
		System.out.println();
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		printline();

	}

}
